# =============================================================================
# Bivector Exponential (exp_bivector)
# =============================================================================

@torch.jit.script
def exp_bivector(B: Tensor) -> Tensor:
    """
    Compute exponential of a bivector in Cl(0, 7).

    Converts a bivector (generator) to a rotor (rotation).
    Formula: exp(B) = cos(Î¸) + sin(Î¸)/Î¸ * B where Î¸ = sqrt(-BÂ²)

    Args:
        B: Input bivector, shape (..., 21)

    Returns:
        Rotor, shape (..., 64)
    """
    B_sq = (
        -B[..., 0] * B[..., 0] +
        -B[..., 1] * B[..., 1] +
        -B[..., 2] * B[..., 2] +
        -B[..., 3] * B[..., 3] +
        -B[..., 4] * B[..., 4] +
        -B[..., 5] * B[..., 5] +
        -B[..., 6] * B[..., 6] +
        -B[..., 7] * B[..., 7] +
        -B[..., 8] * B[..., 8] +
        -B[..., 9] * B[..., 9] +
        -B[..., 10] * B[..., 10] +
        -B[..., 11] * B[..., 11] +
        -B[..., 12] * B[..., 12] +
        -B[..., 13] * B[..., 13] +
        -B[..., 14] * B[..., 14] +
        -B[..., 15] * B[..., 15] +
        -B[..., 16] * B[..., 16] +
        -B[..., 17] * B[..., 17] +
        -B[..., 18] * B[..., 18] +
        -B[..., 19] * B[..., 19] +
        -B[..., 20] * B[..., 20]
    )

    # Î¸Â² = -BÂ² (bivectors square to negative in Euclidean)
    theta_sq = -B_sq

    # Handle both positive (elliptic) and negative (hyperbolic) cases
    # For numerical stability, use small angle approximation when Î¸ â 0
    eps = 1e-8

    # Elliptic case: Î¸Â² > 0 => exp(B) = cos(Î¸) + sin(Î¸)/Î¸ * B
    # Hyperbolic case: Î¸Â² < 0 => exp(B) = cosh(Î¸) + sinh(Î¸)/Î¸ * B
    theta = torch.sqrt(torch.abs(theta_sq) + eps)

    # Compute cos/cosh and sinc (sin(Î¸)/Î¸ or sinh(Î¸)/Î¸)
    is_elliptic = theta_sq > 0
    cos_term = torch.where(is_elliptic, torch.cos(theta), torch.cosh(theta))
    sinc_term = torch.where(
        is_elliptic,
        torch.sin(theta) / theta,
        torch.sinh(theta) / theta
    )

    # Build rotor: scalar part + bivector parts
    r0 = cos_term
    r1 = sinc_term * B[..., 0]
    r2 = sinc_term * B[..., 1]
    r3 = sinc_term * B[..., 2]
    r4 = sinc_term * B[..., 3]
    r5 = sinc_term * B[..., 4]
    r6 = sinc_term * B[..., 5]
    r7 = sinc_term * B[..., 6]
    r8 = sinc_term * B[..., 7]
    r9 = sinc_term * B[..., 8]
    r10 = sinc_term * B[..., 9]
    r11 = sinc_term * B[..., 10]
    r12 = sinc_term * B[..., 11]
    r13 = sinc_term * B[..., 12]
    r14 = sinc_term * B[..., 13]
    r15 = sinc_term * B[..., 14]
    r16 = sinc_term * B[..., 15]
    r17 = sinc_term * B[..., 16]
    r18 = sinc_term * B[..., 17]
    r19 = sinc_term * B[..., 18]
    r20 = sinc_term * B[..., 19]
    r21 = sinc_term * B[..., 20]
    r22 = torch.zeros_like(B[..., 0])
    r23 = torch.zeros_like(B[..., 0])
    r24 = torch.zeros_like(B[..., 0])
    r25 = torch.zeros_like(B[..., 0])
    r26 = torch.zeros_like(B[..., 0])
    r27 = torch.zeros_like(B[..., 0])
    r28 = torch.zeros_like(B[..., 0])
    r29 = torch.zeros_like(B[..., 0])
    r30 = torch.zeros_like(B[..., 0])
