    r33 = torch.zeros_like(B[..., 0])
    r34 = torch.zeros_like(B[..., 0])
    r35 = torch.zeros_like(B[..., 0])
    r36 = torch.zeros_like(B[..., 0])
    r37 = torch.zeros_like(B[..., 0])
    r38 = torch.zeros_like(B[..., 0])
    r39 = torch.zeros_like(B[..., 0])
    r40 = torch.zeros_like(B[..., 0])
    r41 = torch.zeros_like(B[..., 0])
    r42 = torch.zeros_like(B[..., 0])
    r43 = torch.zeros_like(B[..., 0])
    r44 = torch.zeros_like(B[..., 0])
