# =============================================================================
# Rotor Logarithm (log_rotor)
# =============================================================================

@torch.jit.script
def log_rotor(r: Tensor) -> Tensor:
    """
    Compute logarithm of a rotor in Cl(0, 7).

    Converts a rotor (rotation) to a bivector (generator).
    Formula: log(R) = atan2(|B|, s) / |B| * B where R = s + B

    Args:
        r: Input rotor, shape (..., 64)

    Returns:
        Bivector, shape (..., 21)
    """
    s = r[..., 0]  # Scalar part

    # Compute |B|Â² from bivector parts of rotor
    B_norm_sq = (
        r[..., 1] * r[..., 1] +
        r[..., 2] * r[..., 2] +
        r[..., 3] * r[..., 3] +
        r[..., 4] * r[..., 4] +
        r[..., 5] * r[..., 5] +
        r[..., 6] * r[..., 6] +
        r[..., 7] * r[..., 7] +
        r[..., 8] * r[..., 8] +
        r[..., 9] * r[..., 9] +
        r[..., 10] * r[..., 10] +
        r[..., 11] * r[..., 11] +
        r[..., 12] * r[..., 12] +
        r[..., 13] * r[..., 13] +
        r[..., 14] * r[..., 14] +
        r[..., 15] * r[..., 15] +
        r[..., 16] * r[..., 16] +
        r[..., 17] * r[..., 17] +
        r[..., 18] * r[..., 18] +
        r[..., 19] * r[..., 19] +
        r[..., 20] * r[..., 20] +
        r[..., 21] * r[..., 21]
    )

    # Compute angle Î¸ = atan2(|B|, s)
    eps = 1e-8
    B_norm = torch.sqrt(B_norm_sq + eps)
    theta = torch.atan2(B_norm, s)

    # Scale factor: Î¸ / |B|
    scale = theta / (B_norm + eps)

    # Extract bivector components from rotor
    b0 = scale * r[..., 1]
    b1 = scale * r[..., 2]
    b2 = scale * r[..., 3]
    b3 = scale * r[..., 4]
    b4 = scale * r[..., 5]
    b5 = scale * r[..., 6]
    b6 = scale * r[..., 7]
    b7 = scale * r[..., 8]
    b8 = scale * r[..., 9]
    b9 = scale * r[..., 10]
    b10 = scale * r[..., 11]
    b11 = scale * r[..., 12]
    b12 = scale * r[..., 13]
    b13 = scale * r[..., 14]
    b14 = scale * r[..., 15]
    b15 = scale * r[..., 16]
    b16 = scale * r[..., 17]
    b17 = scale * r[..., 18]
    b18 = scale * r[..., 19]
    b19 = scale * r[..., 20]
    b20 = scale * r[..., 21]

    return torch.stack([
        b0, b1, b2, b3, b4, b5, b6, b7,
        b8, b9, b10, b11, b12, b13, b14, b15,
        b16, b17, b18, b19, b20,
    ], dim=-1)

# =============================================================================
# Rotor SLERP (Spherical Linear Interpolation)
# =============================================================================

@torch.jit.script
def slerp_rotor(r1: Tensor, r2: Tensor, t: Tensor) -> Tensor:
    """
    Spherical linear interpolation between rotors in Cl(0, 7).

    Formula: slerp(r1, r2, t) = r1 * exp(t * log(r1~ * r2))

    Args:
        r1: Start rotor, shape (..., 64)
        r2: End rotor, shape (..., 64)
        t: Interpolation parameter [0, 1], shape (...) or scalar

    Returns:
        Interpolated rotor, shape (..., 64)
    """
    # Compute r1~ (reverse of r1)
    r1_rev = reverse_rotor(r1)

    # Compute delta = r1~ * r2
    delta = compose_rotor(r1_rev, r2)

    # Compute log of delta to get bivector
    log_delta = log_rotor(delta)

    # Scale by t
    if t.dim() == 0:
        scaled_log = t * log_delta
    else:
        scaled_log = t.unsqueeze(-1) * log_delta

    # Exponentiate back to rotor
    delta_t = exp_bivector(scaled_log)

    # Compose with r1
    return compose_rotor(r1, delta_t)
